import React from 'react';
import MaterialTable from 'material-table';

export const TableSearch = () => {
    const data = [
        {
            Job: "Web Developper",
            Category: "Software Development",
            Company: "Murex co.",
            Location: "Beirut,Lebanon",
        },
        {
            Job: "Senior Software engineer",
            Category: "Software Development",
            Company: "Trustart co.",
            Location: "Beirut,Lebanon",

        },
        {
            Job: "Project Manager",
            Category: "Management",
            Company: "Cedars Consultancies co.",
            Location: "Tripoli,Lebanon",

        },
        {
            Job: "UI/Ux Designer",
            Category: "Graphic",
            Company: "PSLab co.",
            Location: "Boueir,Lebanon",
        },

    ]
    const columns = [
        {
            title: "Job",
            field: "Job",
        },
        {
            title: "Category",
            field: "Category",
        },
        {
            title: "Company",
            field: "Company",
        },
        {
            title: "Location",
            field: "Location",
        },
    ]

    return(
        <div>
            <MaterialTable title="JobsSearched"
            data={data}
            columns={columns}
            />

           
        </div>
    )
}
